import React from 'react';

const Card = (props) => {
    const {name, email} = props;
    return (
        <div className="whacky">
            <img alt='Robot' src ={`https://robohash.org/${props.id}`} height='220px' width='220px'/>
            <div>
                <h2>{name}</h2>
                <p>{email}</p>
            </div>
        </div>
    );
}

export default Card;
